import './App.css';

function Welcome() {
  return (
    <section>
      <h1>Hello World</h1>
    </section>
  );
}

export default Welcome;

function App(){
  return (
    <div className='App'>
      <Welcome />
      <Welcome />
      <Welcome />
    </div>
  )
}

